import SearchContext from "./context/stateContext";
import { DispatchSearch } from "./SearchProvider";
const InputSearch = () => {
    const yo = useContext(SearchContext);
    const dispatch = useContext(DispatchSearch);
    console.log("YOO:", yo);
    return (
        <div>
            <h1 onClick={() => yo.actions.interpretedSend("SOME_ACTION")}>
                CLICK ME
            </h1>
            <input type="text" value="" placeholder="find vacancies" />
            <h1>{yo.actor.value}</h1>
        </div>
    );
};

export default InputSearch;
